import React, { useState } from "react";
import "../App.css";

const onSubmit = async (formData) => {
    try {
      const response = await fetch(
        "https://josephpongonthara.usw-16.palantirfoundry.com/api/v1/ontologies/UserProfile",
        {
          method: "POST",
          headers: {
            "Authorization": `Bearer ${token}`, 
            "Content-Type": "application/json"
          },
          body: JSON.stringify({
            user_id: formData.name,
            equipment_type: formData.equipment,
            preferred_brand: formData.brands,
            aspects_to_optimize: formData.optimize,
            play_style: formData.playStyle,
            play_frequency: formData.frequency
          })
        }
      );

      if (!response.ok) {
        throw new Error(`Failed to save user profile: ${response.statusText}`);
      }

      // 2. Navigate to next page (if using React Router)
      navigate("/results", { state: { userInput: formData } });

    } catch (err) {
      console.error("Error during submission:", err);
      alert("There was an error submitting your form. Check console.");
    }
  };

const PageOne = ({ onSubmit }) => {
  const [formState, setFormState] = useState({
    name: "",
    equipment: "",
    brands: [],
    optimize: [],
    playstyle: "",
    frequency: ""
  });
  const [step, setStep] = useState(1);

  const handleChange = (field, value) => {
    setFormState(prev => ({ ...prev, [field]: value }));
    setStep(step + 1);
  };

  const toggleArrayField = (field, value) => {
    setFormState(prev => {
      const current = new Set(prev[field]);
      current.has(value) ? current.delete(value) : current.add(value);
      return { ...prev, [field]: [...current] };
    });
  };

  const canSubmit = formState.name && formState.equipment && formState.optimize.length && formState.playstyle && formState.frequency;

  return (
    <div className="page">
      <div className="logo-title">
        <div className="logo-placeholder" />
        <h1 className="title">Personal Pro Shop</h1>
      </div>
      <h2 className="main-header">Welcome to your Personal Pro Shop</h2>
      <p className="sub-header">How can we assist you today?</p>

      {step >= 1 && (
        <div className="question">
          <label>What is your name?</label>
          <input type="text" value={formState.name} onChange={e => handleChange("name", e.target.value)} />
        </div>
      )}

      {step >= 2 && (
        <div className="question">
          <label>What equipment are you looking for?</label>
          {["racket", "strings", "racket & strings"].map(opt => (
            <div key={opt}>
              <input type="radio" id={opt} name="equipment" value={opt} onChange={e => handleChange("equipment", e.target.value)} />
              <label htmlFor={opt}>{opt}</label>
            </div>
          ))}
        </div>
      )}

      {(formState.equipment === "racket" || formState.equipment === "racket & strings") && step >= 3 && (
        <div className="question">
          <label>Do you have a preferred brand for your racket?</label>
          {["head", "wilson", "yonex", "babolat", "volkl", "prokennex", "prince", "dunlop", "tecnifibre"].map(brand => (
            <div key={brand}>
              <input type="checkbox" id={brand} onChange={() => toggleArrayField("brands", brand)} />
              <label htmlFor={brand}>{brand}</label>
            </div>
          ))}
        </div>
      )}

      {step >= 4 && (
        <div className="question">
          <label>What elements of your game/equipment are you looking to optimize?</label>
          <small>(You can select up to 3)</small>
          {["Power", "Control", "Spin", "Durability"].map(item => (
            <div key={item}>
              <input
                type="checkbox"
                id={item}
                onChange={() => {
                  if (formState.optimize.includes(item)) toggleArrayField("optimize", item);
                  else if (formState.optimize.length < 3) toggleArrayField("optimize", item);
                }}
              />
              <label htmlFor={item}>{item}</label>
            </div>
          ))}
        </div>
      )}

      {step >= 5 && (
        <div className="question">
          <label>What is your preferred play style?</label>
          {["baseline", "net-court", "all-court"].map(style => (
            <div key={style}>
              <input type="radio" id={style} name="playstyle" value={style} onChange={e => handleChange("playstyle", e.target.value)} />
              <label htmlFor={style}>{style}</label>
            </div>
          ))}
        </div>
      )}

      {step >= 6 && (
        <div className="question">
          <label>How many times a week do you play?</label>
          {[1, 2, 3, 4, 5, 6, 7].map(n => (
            <div key={n}>
              <input type="radio" id={`freq-${n}`} name="frequency" value={n} onChange={e => handleChange("frequency", e.target.value)} />
              <label htmlFor={`freq-${n}`}>{n}</label>
            </div>
          ))}
        </div>
      )}

      {canSubmit && (
        <button className="submit-button" onClick={() => onSubmit(formState)}>Get Recommendation</button>
      )}
    </div>
  );
};

export default PageOne;
